 *  通知app调起包月流程
 *
 *  支持平台：书旗Android、书旗iOS
 *
 *  @param jsonString callback：包月成功后回调H5的方法名称
 *
 *  @example
 *  libSQ.exec('call-app-buy-monthly').then((info) => {
 *    console.log(`[call-app-buy-monthly][then] ${JSON.stringify(info, null, 2)}`);
 *  }).catch((err) => {
 *    alert(`[call-app-buy-monthly][error] ${JSON.stringify(err, null, 2)}`);
 *    alert(err.detail.__$rawError__.stack);
 *  });
 *
 *  @return 0：传入参数解析失败 1：传入参数解析成功

